                  .prepend('[data-section="step3"] [data-label="costsList"]');
        })
        .then(() => {
            createToast({
                title: 'Kost aanmaken',
                content: 'Kost werd aangemaakt'
            })
        })
        .catch((error) => {
            appError('Error writing document', error, costs.add);
            createToast({
                title: 'Kost aanmaken',
                content: 'Kost kon niet worden aangemaakt'
            })
        });
    },

    async getAll(id = window.appSettings.selectedBudget.id) {
        const snapshot = await costs.getCollection(id).get();
        const data = snapshot.docs.map((querySnapshot) => {
            return {
                id: querySnapshot.id,
                data: querySnapshot.data()
            }
        })
        return data;
    },

    async get(id) {
        const snapshot = await costs.getCollection().doc(id).get();
        return {
            id: id,
            data: snapshot.data()
        };
    },

    async edit({title, comment, category, amount, type, when}, id, listItem) {
        costs.getCollection().doc(id).update({
            title: title,
            comment: comment,
            category: category,
            amount: amount,
            type: type,
            when: when,
            edited: new Date()
        }).then(() => {
            const updatedListItem = render.cost({id: id, data: {title, comment, category,amount, type, when}}).el;
